import React from "react";
import Cell from "./Cell.js";


class Ranked extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            body: [],
            link: (props.location.pathname),
            title: (props.location.pathname.replace(props.match.url, ""))
        }
    }


    giveOrder() {
        let count = 0;
        console.log("HERE");
        this.state.body.map(player => {
            console.log("HERE");
            player.setState({ rank: count });
            console.log("HERE");
            console.log(player.rank);
        });
        count++;
    }

    componentDidMount() {
        fetch(this.state.link)

            .then(res => res.json())
            .then(body => {
                this.setState({ body })
            })
            .then(this.giveOrder());

        fetch("/getTitle" + (this.state.title))
            .then(res => res.json())
            .then(name => {
                this.setState({ title: name[0].name });
            });



        fetch("/search")
            .then(res => res.json())
            .then(title => this.setState({ title: title.name }));
        this.index = 1;
    }



    render() {
        return (
            <div>
                <div className="title"><a>{this.state.title}</a></div>
                <table className="ranked_table">
                    <tbody>
                        {this.state.body.map(player => React.createElement(Cell, [player, this.index++]))}
                    </tbody>
                </table>
                {/*--<div id="vote_btn"><a>RANK</a></div>*/}
                <a className="notice">The rank will be sorted once you refresh/exit the page</a>
            </div>
        );
    }
}
export default Ranked;
